import React from "react";
import { HeaderFontPreview } from "./headerFont";

interface KhmerFontPreviewProps {
    previewText: string;
}

export const KhmerFont: React.FC<KhmerFontPreviewProps> = ({ previewText }) => {

    const khmertype = [
        "MyanmarAngoun",
        "MyanmarChatu",
        "MyanmarChatuLight",
        "MyanmarGantgaw",
        "MyanmarKhyay",
        "MyanmarKuttar",
        "MyanmarNayone",
        "MyanmarNjaun",
        "MyanmarPauklay",
        "MyanmarPhetsot",
        "MyanmarPhiksel",
        "MyanmarPhikselSmooth",
        "MyanmarPonenyet",
        "MyanmarSabae",
        "MyanmarSagar",
        "MyanmarSanpya",
        "MyanmarTagu",
        "MyanmarThuriya",
        "MyanmarWaso",
        "MyanmarYinmar"];

    return (
        <>
        <FontPreview title="Khmer Fonts" previewText={previewText}/>


        </>
    );
};
